{"name":"loofah","downloads":291565592,"version":"2.17.0","version_created_at":"2022-04-28T13:35:58.289Z","version_downloads":179908,"platform":"ruby","authors":"Mike Dalessio, Bryan Helmkamp","info":"Loofah is a general library for manipulating and transforming HTML/XML documents and fragments, built on top of Nokogiri.

Loofah excels at HTML sanitization (XSS prevention). It includes some nice HTML sanitizers, which are based on HTML5lib's safelist, so it most likely won't make your codes less secure. (These statements have not been evaluated by Netexperts.)

